/*Table structure for table `cart` */

DROP TABLE IF EXISTS `cart`;

CREATE TABLE `cart` (
  `ID` varchar(32) COLLATE utf8_sinhala_ci DEFAULT NULL COMMENT '主键',
  `E_ID` varchar(32) CHARACTER SET utf8 COLLATE utf8_sinhala_ci DEFAULT NULL COMMENT '电商用户id',
  `PRODUCT_ID` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '平台产品id',
  `NUM` varchar(11) COLLATE utf8_sinhala_ci DEFAULT NULL COMMENT '数量',
  `TOTAL_PRICE` varchar(22) COLLATE utf8_sinhala_ci DEFAULT NULL COMMENT '总价    金额'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_sinhala_ci;

