/*Table structure for table `product` */

DROP TABLE IF EXISTS `product`;

CREATE TABLE `product` (
  `ID` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '主键  产品id',
  `CODE` int(22) DEFAULT NULL COMMENT '服务商编号',
  `NAME` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '产品名称',
  `IMG` blob COMMENT '图片',
  `INFO` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '产品简介',
  `MAPKET_PRICE` int(22) DEFAULT NULL COMMENT '市场价格',
  `STORE_NUM` int(22) DEFAULT NULL COMMENT '库存量',
  `SALE_NUM` int(22) DEFAULT NULL COMMENT '已售数量',
  `SHOW_ORDER` int(22) DEFAULT NULL COMMENT '排序',
  `STATUS` int(22) DEFAULT NULL COMMENT '状态(1、在线,2、下线)',
  `STYLE_ID` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  `TYPE_ID` varchar(32) DEFAULT NULL,
  `UNIT` varchar(8) DEFAULT NULL,
  PRIMARY KEY (`ID`)
