/*Table structure for table `service_order` */

DROP TABLE IF EXISTS `service_order`;

CREATE TABLE `service_order` (
  `ID` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '主键  服务订单',
  `PROVIDER_ID` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '服务商id',
  `SERVICE_NO` varchar(32) DEFAULT NULL COMMENT '订单服务编号',
  `ORDER_ID` varchar(32) DEFAULT NULL COMMENT '业务员订单',
  `E_ID` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '电商用户id',
  `PRODUCT_ID` varchar(32) DEFAULT NULL COMMENT '平台产品id',
  `SERVICE_ID` varchar(32) DEFAULT NULL COMMENT '服务商产品id',
  `SERVICE_NAME` varchar(64) DEFAULT NULL COMMENT '服务名称',
  `SERVICE_INFO` varchar(1024) DEFAULT NULL COMMENT '服务内容',
  `UNIT_PRICE` int(22) DEFAULT NULL COMMENT '单价',
  `BUY_NUM` int(22) DEFAULT NULL COMMENT '购买数量',
  `TOTAL_PRICE` int(22) DEFAULT NULL COMMENT '总费用',
  `CREATE_TIME` date DEFAULT NULL COMMENT '创建时间',
  `SERVICE_REQUEST` varchar(1024) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '服务请求*',
  `UNIT` varchar(16) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '单位*',
  `STATUS` int(22) DEFAULT NULL COMMENT '1.未支付2.分配服务商3.服务商服务中4.已完成5.已取消',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `service_order` */

insert  into `service_order`(`ID`,`PROVIDER_ID`,`SERVICE_NO`,`ORDER_ID`,`E_ID`,`PRODUCT_ID`,`SERVICE_ID`,`SERVICE_NAME`,`SERVICE_INFO`,`UNIT_PRICE`,`BUY_NUM`,`TOTAL_PRICE`,`CREATE_TIME`,`SERVICE_REQUEST`,`UNIT`,`STATUS`) values ('1','1','1','1','1','1','1','冰雪奇缘2','为了探寻父母遇难的真相与寻找艾莎魔力的由来...',36,1,36,'2019-11-13','2','2',NULL),('2','1','2','2','1','2','2','蜘蛛侠：英雄远征','讲述了蜘蛛侠彼得·帕克要和同学们一起去欧洲旅行...',69,1,69,'2019-11-26',NULL,NULL,NULL),('3','2','3','3','2','3','3','驯龙高手','故事讲述一个住在博克岛的维京少年希卡普...',36,1,36,'2019-11-25',NULL,NULL,NULL);

/*Table structure for table `sysuser` */

DROP TABLE IF EXISTS `sysuser`;

CREATE TABLE `sysuser` (
  `ID` varchar(32) NOT NULL COMMENT '主键',
  `USER_NAME` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '名字',
  `HEAD_IMG` blob COMMENT '头像',
  `LOGIN_ID` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '登录名',
  `PASSWORD` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '密码',
  `EMAIL` varchar(256) DEFAULT NULL COMMENT '邮箱',
  `CELLPHONE` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '手机号',
  `STATUS` int(22) DEFAULT NULL COMMENT '状态（1：有效2：无效）',
  `REGISTER_TIME` date DEFAULT NULL COMMENT '注册时间',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

